import{_ as l,c as t,o as i,a1 as r}from"./chunks/framework.Dz2Wi2T-.js";const p=JSON.parse('{"title":"数据概览","description":"","frontmatter":{},"headers":[],"relativePath":"guide/data-overview.md","filePath":"guide/data-overview.md"}'),o={name:"guide/data-overview.md"};function e(n,a,s,d,u,h){return i(),t("div",null,a[0]||(a[0]=[r('<h1 id="数据概览" tabindex="-1">数据概览 <a class="header-anchor" href="#数据概览" aria-label="Permalink to &quot;数据概览&quot;">​</a></h1><p>数据概览页面是您监控平台整体运行状态、跟踪项目进展和管理资源消耗的核心枢纽。通过该页面，您可以直观地了解平台的关键指标、所有项目的实时进度以及团队的积分使用情况，从而做出更明智的决策。</p><h2 id="核心模块" tabindex="-1">核心模块 <a class="header-anchor" href="#核心模块" aria-label="Permalink to &quot;核心模块&quot;">​</a></h2><p>数据概览主要包含三大核心模块：</p><h3 id="_1-平台运行状态监控" tabindex="-1">1. 平台运行状态监控 <a class="header-anchor" href="#_1-平台运行状态监控" aria-label="Permalink to &quot;1. 平台运行状态监控&quot;">​</a></h3><p>实时监控平台的健康状况和关键性能指标，确保一切运行顺畅。</p><ul><li><strong>关键指标</strong>：展示平台的整体负载、AI处理任务队列、服务响应时间等核心数据。</li><li><strong>资源监控</strong>：跟踪计算资源、存储空间等系统资源的使用情况。</li></ul><h3 id="_2-项目进度统计" tabindex="-1">2. 项目进度统计 <a class="header-anchor" href="#_2-项目进度统计" aria-label="Permalink to &quot;2. 项目进度统计&quot;">​</a></h3><p>集中展示所有项目的进展情况，帮助您快速掌握交付动态。</p><ul><li><strong>项目概览</strong>：提供所有项目的总体进度视图。</li><li><strong>最近交付</strong>：高亮显示近期完成或即将交付的项目。</li><li><strong>任务统计</strong>：按日、周、月等维度统计任务完成情况，分析团队生产力。</li></ul><h3 id="_3-积分使用趋势" tabindex="-1">3. 积分使用趋势 <a class="header-anchor" href="#_3-积分使用趋势" aria-label="Permalink to &quot;3. 积分使用趋势&quot;">​</a></h3><p>详细记录并分析团队的积分消耗情况，帮助您优化成本和预算。</p><ul><li><strong>消耗趋势</strong>：以图表形式展示积分在不同时间段内的使用趋势。</li><li><strong>消耗分布</strong>：分析积分在各项功能（如视频处理、AI计算等）上的具体分布情况。</li><li><strong>余额监控</strong>：实时显示当前积分余额，并提供低余额预警。</li></ul><h2 id="操作指南" tabindex="-1">操作指南 <a class="header-anchor" href="#操作指南" aria-label="Permalink to &quot;操作指南&quot;">​</a></h2><ol><li><p><strong>访问数据概览</strong></p><ul><li>登录平台后，在主导航栏中点击“数据概览”即可进入该页面。</li></ul></li><li><p><strong>查看平台运行状态</strong></p><ul><li>页面顶部会实时显示平台的关键性能指标，帮助您快速了解系统健康状况。</li></ul></li><li><p><strong>监控项目进度</strong></p><ul><li>在“项目进度统计”模块，您可以选择不同的时间范围（单日、单周、单月）来查看任务完成情况。</li><li>点击特定项目可跳转至项目详情页，了解更详细的进度信息。</li></ul></li><li><p><strong>分析积分使用</strong></p><ul><li>“积分使用趋势”模块提供了交互式图表，您可以悬停在图表上查看具体时间点的消耗数据。</li><li>“消耗分布”饼图清晰地展示了各项功能所占的积分比例。</li></ul></li></ol><h2 id="注意事项" tabindex="-1">注意事项 <a class="header-anchor" href="#注意事项" aria-label="Permalink to &quot;注意事项&quot;">​</a></h2><ul><li><strong>数据延迟</strong>：所有统计数据可能存在1-5分钟的延迟，请在分析时考虑此因素。</li><li><strong>数据范围</strong>：项目和任务统计默认显示特定时间范围内的数据，您可以根据需要切换筛选条件。</li><li><strong>无数据记录</strong>：如果在特定时间段内没有积分消耗或任务完成，相关图表区域将显示“暂无数据”。</li><li><strong>联系支持</strong>：如对数据有任何疑问或发现异常，请随时联系我们的技术支持团队。</li></ul>',17)]))}const c=l(o,[["render",e]]);export{p as __pageData,c as default};
